import NavigationBar from "../util/navigation/NavigationBar";
import Container from "../util/container/Container";
import TextField from "@mui/material/TextField";
import ToggleButton from "../util/button/ToggleButton";

import React, { useState } from "react";

import "./Schematic.css";

const buttons = [
	{ name: "size", value: ["small", "medium", "big", "THICK"] },
	{ name: "type", value: ["core", "ore", "remote"] },
	{ name: "planet", value: ["serpulo", "erekir"] },
	{ name: "rank", value: ["ascendant", "descendant"] },
];

const buildResult = (input) => {
	return <li key={input.id}>{input.text}</li>;
};

const Schematic = () => {
	const [inputText, setInputText] = useState([{ id: "1", text: "Hoho" }]);
	const handleInput = (e) => {
		setInputText(obj);
	};

	return (
		<div className="schematic">
			<NavigationBar />
			<div className="search-bar">
				<div id="search">
					<TextField
						variant="outlined"
						label="Search for schematic"
						onChange={handleInput}
						inputProps={{ style: { width: "400px" } }}
					/>
					<Container input={inputText} func={buildResult} />
				</div>
				<div className="tag-container">
					{buttons.map((button, index) => {
						return <ToggleButton key={index} button={button} />;
					})}
				</div>
			</div>
		</div>
	);
};

const obj = [
	{
		id: 1,
		text: "Devpulse",
	},
	{
		id: 2,
		text: "Linklinks",
	},
	{
		id: 3,
		text: "Centizu",
	},
	{
		id: 4,
		text: "Dynabox",
	},
	{
		id: 5,
		text: "Avaveo",
	},
	{
		id: 6,
		text: "Demivee",
	},
	{
		id: 7,
		text: "Jayo",
	},
	{
		id: 8,
		text: "Blognation",
	},
	{
		id: 9,
		text: "Podcat",
	},
	{
		id: 10,
		text: "Layo",
	},
];

export default Schematic;
